import React from "react";
import { Container } from "../components/Grid";
// import Jumbotron from "../components/Jumbotron";
import Iframe from "react-iframe";
function Result() {
  return (
    <Container fluid>
      <Iframe
        url="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300"
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
        style="width: 300px; height: 300px; margin: 0; padding: 0; overflow: hidden; border: 0;"
      />
    </Container>
  );
}



export default Result;
